/// <summary>
///
/// </summary>
[SysODataActionAttribute("insertWellSkyAPIResponse", false)]
public static RecId insertDataForWellSkyAPIResponse(RefRecId _hmWellSkyAPIRequest, HMMessage _message, HMHTTPStatusCode _httpStatusCode)
{
    HMWellSkyAPIResponse hmWellskyAPIResponse;
    HMWellSkyAPIRequest  hmWellskyAPIRequest; 
    RecId                hmWellskyAPIResponseRecID = 0;

    try
    {
        hmWellskyAPIResponse.HMWellSkyAPIRequest        = _hmWellSkyAPIRequest;
        hmWellskyAPIResponse.Message                    = _message;
        hmWellskyAPIResponse.HTTPStatusCode             = _httpStatusCode != '' ? _httpStatusCode : '';

        hmWellskyAPIResponse.insert();
        hmWellskyAPIResponseRecID = hmWellSkyAPIResponse.RecId;

        if (_httpStatusCode != '204' && _hmWellSkyAPIRequest)
        {
            select firstonly hmWellskyAPIRequest 
                where hmWellskyAPIRequest.RecId == _hmWellSkyAPIRequest;

            if(hmWellskyAPIRequest)
            {
                ttsbegin;
                hmWellskyAPIRequest.selectForUpdate(true);
                hmWellskyAPIRequest.MessageSent = 0;
                hmWellskyAPIRequest.update();
                ttscommit;
            }

        }
    }
    catch
    {
        throw;
    }

    return hmWellskyAPIResponseRecID;
}
